import React from 'react';
import '../../App.css';
import Footer from '../footer/Footer';
import Buy from './mainpages/buy/Buy';

export default function SignUp() {
  return (
    <>
      <h1 className='sign-up'>
        <div className="heading white-heading" style={{ padding: "50px" }, { fontSize: "60px", color: "red" }}>BUY</div>
      </h1>
      <Buy />
      <Footer />
    </>
  );
}
